eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   reviews: () => (/* binding */ reviews)\n/* harmony export */ });\nconst reviews = {\n    \"Preacher’s Daughter\": {\n        \"pictureDescription\": `Listened to Preacher's Daughter driving up to Yosemite with Anwesha!`,\n        \"pictureUrl\": \"/images/preachers_daughter.jpg\",\n        \"favorite\": true,\n        \"rating\": 4\n    },\n    \"Frailty\": {\n        \"review\": `\"Your Clothes\" was the song that first introduced me to Jane Remover, and while I prefer her style on \"Census Designated\", \"Frailty\" is an incredible time capsule of 2020s hyperpop and Jane herself as an artist. I'm sad that the promotional ARG surrounding this album's release was scrapped - the pieces that survived provided a lot of context for the locations and time frames referenced on the album.\n                  `,\n        \"favorite\": true,\n        \"rating\": 4\n    },\n    \"softscars\": {\n        \"review\": `I honestly don't remember much because I was trying to dodge horrific LA traffic for the duration of this album\n                  `\n    },\n    \"Crest\": {\n        \"pictureDescription\": `First heard Five Star Crest traveling home from a day trip to Blair Atholl Castle`,\n        \"pictureUrl\": \"/images/crest.jpg\",\n        \"favorite\": true,\n        \"recommended\": \"Law\",\n        \"rating\": 4\n    },\n    \"BRAT\": {\n        \"review\": `The soundtrack to my spring, summer and fall! Full of good, personal, danceable hits, but less-structured songs like \"i think about it all the time\" or \"Girl, so confusing\" don't hold their own against \"Von Dutch\" or \"Sympathy is a Knife\" - in my opinion, this stream-of-consciousness writing style doesn't suit A.G. Cook's production. Regardless, Charli's it-girl persona is infectious, and BRAT makes the most mundane tasks feel fresh.\n                `,\n        \"favorite\": true,\n        \"recommended\": \"Law\",\n        \"rating\": 5\n    },\n    \"OIL OF EVERY PEARL'S UN-INSIDES\": {\n        \"review\": `Despite my best efforts, SOPHIE's work has remained too experimental for me. I deeply respect the impact she made in pioneering pop/hyperpop, but her work focuses more on sound than song, and as a result most tracks felt like technical demonstrations rather than compositions. I really did want to love this album and I hope her posthumous release changes my judgements.\n                  `\n    },\n    \"I LAY DOWN MY LIFE FOR YOU\": {\n        \"review\": `Thrilled to experience this live. JPEGMAFIA has an incredible gift for picking samples and a willingness to draw those samples from truly baffling sources. Watching underscores break down her production style on “Heck” made me appreciate artists who hear a random sound effect (like a line in Succession!) and think \"I can build a song around this”. It takes a lot of musical/cultural knowledge to do that, plus heavy faith in your own abilities as a producer to make something cohesive - thoroughly impressed.\n                  `,\n        \"favorite\": true,\n        \"rating\": 5\n    },\n    \"KiCk i\": {\n        \"review\": `My initial thoughts: hard to ease into, but after the first few listens almost every song becomes addictive. This was one of my top albums this year and what introduced me to Arca's body of work, and it's the strongest of the quintet, with the possible exception of KiCK ii. The emotional and sonic shift from Nonbinary to Time is incredible and really characterizes the album and the direction Arca's music would take, and KiCK seems to build upon the promise for the future of music that SOPHIE's Oil Of Every Pearl's Uninsides established in 2018. \n                  `,\n        \"favorite\": true,\n        \"rating\": 4.5\n    },\n    \"KICK ii\": {\n        \"review\": `Most of my favorite songs from the quintet are on this album, and like Kick i, Kick ii crosses a wide range of styles and emotions: Prada, Tiro and Rakata are instant jolts of energy, while Luna Llena and Confianza have a contemplative, heartbreaking, almost religious quality to them. Kick ii is emotionally vulnerable even in moments of strength and confidence, and sets up for the slower pace of Kick iiii and iiiii.\n                  `,\n        \"favorite\": true,\n        \"rating\": 5\n    },\n    \"Soft Rock\": {\n        \"review\": `I liked the singles that I'd already heard from the album, but no other song stuck out to me, and even the singles weren't too memorable. Good background music, or I need to listen to it a few more times, but I expected more from AG Cook + EASYFUN given their previous work.\n                  `,\n        \"favorite\": false,\n        \"rating\": 3\n    },\n    \"Exile In Guyville\": {\n        \"review\": `\n                    I wasn't expecting to like this as much as I did! Liz Phair's lyricism/word choices are very complex for the subject matter. \n                    Her songs also have a rawness to them that resonates with me so rarely, and it sounds more personal here than\n                    on albums like \"brat\" which received similar commercial praise for authenticity. The imagery of \"Stratford on Guy\" was\n                    memorable in my first listen, and on repeated listens I've found myself drawn to the parables in \"Divorce Song\" and \"Fuck and Run\".\n                  `,\n        \"favorite\": true,\n        \"rating\": 5\n    },\n    \"food house\": {\n        \"review\": `\n                   Fraixom's lyricism never fails to amaze me. Food house would probably be incredible to experience live.\n                  `,\n        \"favorite\": false,\n        \"rating\": 3.5\n    },\n    \"Veteran\": {\n        \"review\": `\n                   It's been interesting to watch JPEGMAFIA's production thoroughly transform following \"SCARING THE HOES\" and his collaboration with Danny Brown. This album had a few standouts,\n                   but overall didn't capture me as much as \"I LAY DOWN MY LIFE FOR YOU\" did.\n                  `,\n        \"favorite\": false,\n        \"rating\": 3\n    },\n    \"how i'm feeling now\": {\n        \"review\": `Such a pinnacle of 2020 hyperpop. Ripe with emotional honesty and conjures nostalgia for the collective loss of time that we experienced under quarantine. \"forever\" and its accompanying music video will always make me emotional. Charli's persona has grown so much since this album - it's funny to see her exist as an e-girl fashion time capsule in the music video for \"claws\".\n                  `,\n        \"favorite\": true,\n        \"rating\": 4\n    },\n    \"LAUGHINGFISH\": {\n        \"review\": `A more rock-esque direction for Black Dresses, which I ended up enjoying! Devi's vocals are softer on this one which is an interesting change of pace, and I loved the mental image painted by songs like IF YOU FIND ME GONE. The background for the release of this album provides context for the length and quality of many of the songs on it, and I'm left wondering how many of Ada or Devi's lyrics are about the other. \n                  `,\n        \"favorite\": true,\n        \"rating\": 4.5\n    },\n    \"melanchole (remaster)\": {\n        \"review\": `Either it's Alex G.-esque, or I'm homogenizing the entire bedroom pop genre down to a single person. Albums by teenagers always capture something so raw about growing up, and I'm glad that (unlike Jane Remover...) Salvia Palth was comfortable revisiting and rereleasing his older work with greater production quality.\n                  `,\n        \"favorite\": true,\n        \"rating\": 3\n    },\n    \"E\": {\n        \"review\": `Like Brat, this was the soundtrack to my year! This album hits every emotion you could possibly want from a drainer and the way Ecco discusses isolation seems to come from a more personal perspective than when Bladee sings about similar topics. No-skip album.\n                  `,\n        \"favorite\": true,\n        \"rating\": 5\n    },\n    \"In Rainbows\": {\n        \"review\": `I don't think I'm a Radiohead fan. Live and learn.\n                  `,\n        \"favorite\": true,\n        \"rating\": 2\n    },\n    \"Hounds of Love\": {\n        \"review\": `\n                   Not many thoughts, but I can see Kate Bush's influence on modern-day art pop artists like Eartheater and Polachek.\n                  `,\n        \"favorite\": false,\n        \"rating\": null\n    },\n    \"Short n' Sweet\": {\n        \"review\": `Sabrina Carpenter's persona irritated me this album, especially given the context of her dynamic with Olivia Rodrigo. Then again, I'm not a fan of pop, so I don't know what I was expecting. The production is good, albeit generic, but I preferred her singing (and persona) on fruitcake.`,\n        \"favorite\": false,\n        \"rating\": 2\n    },\n    \"第一幕\": {\n        \"review\": `I love Hanatan's voice - it gives a different kind of depth to Kikuo’s instrumentals than the way he utilizes Vocaloid software. The way Hanatan's voice can go from cutesy to a full belt is impressive. KikuoHana songs feel more operatic as a result of Hanatan’s range as opposed to the crisp, fairy-tale sound Miku’s tuning provides. Filing this album (along with Official Orange) under my mental image of the ideal Dorohedoro soundtrack.`,\n        \"favorite\": false,\n        \"rating\": 4\n    },\n    \"In the Dream of the Sea Life\": {\n        \"pictureDescription\": `Listened to this while making pie for Friendsgiving!`,\n        \"pictureUrl\": \"/images/appaloosa_bones.jpg\",\n        \"favorite\": false\n    },\n    \"Appaloosa Bones\": {\n        \"pictureDescription\": `Listened to this while making pie for Friendsgiving!`,\n        \"pictureUrl\": \"/images/appaloosa_bones.jpg\",\n        \"favorite\": false\n    },\n    \"Everything So Far\": {\n        \"favorite\": false,\n        \"rating\": 1\n    },\n    \"Forever In Your Heart\": {\n        \"review\": `This is the final Black Dresses album I had yet to listen to, and in my opinion it's their weakest. The rock direction they take this album makes many songs sound similar, and unlike LAUGHINGFISH there were no standout singles that grabbed my attention.   \n                  `,\n        \"favorite\": false,\n        \"rating\": 3\n    },\n    \"Everything Is Understood, Cats Live 100 Years\": {\n        \"review\": `This album appeared out of nowhere and ended up being one of my favorites of this whole project. Unfortunately, I haven't found translations for most of this album, but the vocals are so crisp and wistful that my heart aches regardless. \n                  `,\n        \"favorite\": true,\n        \"rating\": 4\n    },\n    \"MG Ultra\": {\n        \"review\": `An excellent synthesis of their work on Gemini and their work on WLFGRL + The Ugly Art + U-Void Synthesizer, while still retaining that classic Machine Girl sound. Wonderful to experience live.\n                  `,\n        \"favorite\": true,\n        \"rating\": 4\n    },\n    \"Cold Visions\": {\n        \"pictureDescription\": `Saw Cold Visions live!`,\n        \"pictureUrl\": \"/images/bladee_concert.jpg\",\n        \"favorite\": false\n    },\n    \"Dookie\": {\n        \"pictureDescription\": `Saw Dookie (and American Idiot) performed live in their entirety for the album's 20th anniversary!`,\n        \"pictureUrl\": \"/images/green_day_concert.jpg\",\n        \"favorite\": false\n    },\n    \"Brat and it’s completely different but also still brat\": {\n        \"pictureDescription\": `Saw Kesha perform Spring Breakers live with Anwesha - probably the best concert I've been to this year`,\n        \"pictureUrl\": \"/images/brat_remix_album.jpg\",\n        \"favorite\": true,\n        \"rating\": 3\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/data/reviews.js\n");

